responses.body:
{
	"Events": [
		{{#each (dataRaw 'Events')}}
		  {{#if (gt @index 0)}}
		    ,
		  {{/if}}
  		{
  			"AccessKeyId": "{{AccessKeyId}}",
  			"CloudTrailEvent": "{\"awsRegion\": \"eu-west-1\", \"eventCategory\": \"Management\", \"eventID\": \"{{EventId}}\", \"eventName\": \"{{EventName}}\", \"eventSource\": \"{{EventSource}}\", \"eventTime\": \"{{EventTime}}\", \"eventType\": \"{{EventType}}\", \"eventVersion\": \"1.08\", \"managementEvent\": true, \"readOnly\": true, \"recipientAccountId\": \"{{AccountId}}\", \"requestID\": \"{{ faker 'datatype.uuid' }}\", \"requestParameters\": null, \"responseElements\": null, \"sourceIPAddress\": \"{{ faker 'internet.ip' }}\", \"tlsDetails\": {\"cipherSuite\": \"ECDHE-RSA-AES128-GCM-SHA256\", \"clientProvidedHostHeader\": \"cloudtrail.eu-west-1.amazonaws.com\", \"tlsVersion\": \"TLSv1.2\"}, \"userAgent\": \"aws-cli/2.11.0 Python/3.11.2 Darwin/22.2.0 source/x86_64 prompt/off command/cloudtrail.lookup-events\", \"userIdentity\": {\"accessKeyId\": \"{{AccessKeyId}}\", \"accountId\": \"{{AccountId}}\", \"arn\": \"arn:aws:sts::{{AccountId}}:assumed-role/{{UserRole}}/{{UserName}}\", \"principalId\": \"{{PrincipalId}}:{{UserName}}\", \"sessionContext\": {\"attributes\": {\"creationDate\": \"{{ faker 'date.past' EventTime }}\", \"mfaAuthenticated\": \"false\"}, \"sessionIssuer\": {\"accountId\": \"{{AccountId}}\", \"arn\": \"arn:aws:iam::{{AccountId}}:role/{{UserRole}}\", \"principalId\": \"{{PrincipalId}}\", \"type\": \"Role\", \"userName\": \"{{UserRole}}\"}, \"webIdFederationData\": {}}, \"type\": \"{{ faker 'name.jobArea' }}\"}}",
  			"EventId": "{{EventId}}",
  			"EventName": "{{EventName}}",
  			"EventSource": "{{EventSource}}",
  			"EventTime": "{{EventTime}}",
  			"ReadOnly": "true",
  			"Resources": [
  			],
  			"Username": "{{UserName}}"
  		}
		{{/each}}
	]
	{{#if (gte (indexOf (urlParam 'NextToken') 'true' 0) 0)}}
	  {{#unless (includes (stringify (body)) 'NextToken')}}
		  ,"NextToken": "{{ faker 'random.alphaNumeric' 64 casing='upper' }}"
		{{/unless}}
	{{/if}}
}

data.value:
[
  {{#each (dataRaw 'EventsTypeData')}}
    {{#if (gte @isEvent 1)}}
    ,
    {{/if}}
    {{setVar 'isEvent' (add (urlParam name) @isEvent)}}
    {{#repeat (urlParam name comma=true)}}
      {
        "AccessKeyId": "{{ faker 'random.alphaNumeric' 20 casing='upper' }}",
        "AccountId": "{{ faker 'random.numeric' 12 }}",
        "EventId": "{{ faker 'datatype.uuid' }}",
        "EventName": "{{oneOf (array 'LookupEvents' 'ListInstanceAssociations' 'AssumeRoleWithWebIdentity')}}",
        "EventSource": "{{oneOf (array 'cloudtrail.amazonaws.com' 'ssm.amazonaws.com' 'sts.amazonaws.com')}}",
        "EventTime": "{{ faker 'date.recent' }}",
        "EventType": "{{name}}",
        "PrincipalId": "{{ faker 'random.alphaNumeric' 20 casing='upper' }}",
        "UserName": "{{ faker 'internet.userName' }}",
        "UserRole": "{{ faker 'name.jobType' }}"
      }
    {{/repeat}}
  {{/each}}
]
